import React from "react";
import { Button, Grid, TextField } from "@mui/material";

export default function NewGroupForm({ db }) {
  const addGroup = () => {
    try {
      db.add({
        name: "Test Group",
        count: [2, 3, 4, 1, 5, 6, 3, 3, 5],
        next: 4,
      }).then(
        (resp) => {
          console.log(resp);
        },
        (error) => {
          throw new Error(error.target.error);
        }
      );
    } catch (error) {
      console.error(error);
    }
  };
  return (
    <>
      <Grid
        container
        justifyContent="center"
        width="800px"
        maxWidth="90vw"
        margin="0 auto"
      >
        <Grid item xs={6}>
          <TextField type="text" label="Group Name" />
        </Grid>
        <Grid item xs={3}>
          <TextField type="number" label="Min Number" />
        </Grid>
        <Grid item xs={3}>
          <TextField type="number" label="Count" />
        </Grid>
        <Grid item>
          <Button variant="contained" size="large" onClick={addGroup}>
            Add Group
          </Button>
        </Grid>
      </Grid>
    </>
  );
}
